import Home from "./components/routes/home/home.component";
import { Routes, Route, Outlet } from "react-router-dom";


const Navigation = () => {
  return (
    <div>
      <div>
        <h1>I am the navigation bar</h1>
      </div>
      <Outlet />
    </div>
  )
}


const App = () => {
  return (
    <Routes>
      <Route path='/' element={<Navigation />}></Route>
      <Route path='/' element={<Home />}>

      </Route>
    </Routes>
  )
};

export default App;
